text:
Oversight isn’t a “felony” unless you’re living under a fascist regime.

@RepMenendez, @RepBonnie & @RepLaMonica have the legal authority to inspect ICE facilities. Instead, they were shoved, harassed by masked agents, and now face bogus arrest threats from Trump’s DHS.

I won’t stay silent.

55% of families go into debt paying for child care.

Instead of doing anything about it, Republicans allowed billions in child care funding to expire.

@HouseDemocrats know that child care is critical and we're fighting to win affordable, accessible child care for all.
